Args:
{
    basePath: '',
    frameworks: ['jasmine', '@angular-devkit/build-angular'],
    plugins: [
      require('karma-jasmine'),
      require('karma-chrome-launcher'),
      require('karma-jasmine-html-reporter'),
      require('karma-coverage-istanbul-reporter'),
      require('@angular-devkit/build-angular/plugins/karma')
    ],
    files: [
      {
        pattern: 'node_modules/monaco-editor/**',
        watched: false,
        included: false,
        served: true,
      },
    ],
    proxies: {
      '/static/assets/monaco-editor/': '/base/node_modules/monaco-editor/',
    },
    client: {
      clearContext: false // leave Jasmine Spec Runner output visible in browser
    },
    coverageIstanbulReporter: {
      dir: require('path').join(__dirname, './coverage/frontend'),
      reports: ['html', 'lcovonly', 'text-summary'],
      fixWebpackSourcePaths: true
    },
    reporters: ['progress', 'kjhtml'],
    port: 9876,
    colors: true,
    logLevel: config.LOG_INFO,
    autoWatch: true,
    browsers: ['Chrome'],
    singleRun: false,
    restartOnFileChange: true
  }

() => {
  beforeEach(() => {
    cy.mockDashboardRequest();
    cy.mockTrialTemplate();
  });

  it('New Experiment form page loads template without errors', () => {
    cy.visit('/new');
    cy.wait(['@mockDashboardRequest', '@mockTrialTemplate']);

    // after fetching the data the page should not have an error snackbar
    cy.get('[data-cy-snack-status=ERROR]').should('not.exist');
  });
}

() => {
    cy.visit('/new');
    cy.wait(['@mockDashboardRequest', '@mockTrialTemplate']);

